import {
	FeatureButton,
	FeatureGrid,
	FeatureHeading,
	FeatureImage,
	FeatureParagraph,
} from "./styles";

import Grid from "../Grid";
import Section from "../Section";

const Feature = () => {
	return (
		<Section>
			<FeatureGrid></FeatureGrid>
		</Section>
	);
};

const mB = { marginBottom: "15px" };

Feature.Title = ({ children }) => (
	<FeatureHeading style={mB}>{children}</FeatureHeading>
);
Feature.Image = ({ props }) => <FeatureImage {...props} />;
Feature.Description = ({ children }) => (
	<FeatureParagraph style={mB}>{children}</FeatureParagraph>
);
Feature.Button = ({ props }) => <FeatureButton {...props} />;

export default Feature;
